"original": |2-
     The character string type TeletexString is a superset of
     PrintableString.  TeletexString supports a fairly standard (ASCII-
     like) Latin character set: Latin characters with non-spacing accents
     and Japanese characters.
"fixed": |-
  The character string type TeletexString is a superset of PrintableString.  TeletexString supports a fairly standard (ASCII- like) Latin character set: Latin characters with non-spacing accents and Japanese characters.
"ko": |-
  문자열 유형 TeletexString은 PrintableString의 상위 집합입니다. TeletexString은 상당히 표준적인(ASCII와 유사한) 라틴 문자 세트(공백 없는 악센트가 있는 라틴 문자 및 일본어 문자)를 지원합니다.
